import React from 'react';
import './Header.css';
import logo from '../sensei-logo-t.svg';

const DropdownMenu = () => {
    return (
        <div className='dropdown.content'>
            <a href='/settings'>Settings</a>
            <a href='/signout'>Sign Out</a>
        </div>
    );
};

const Header = () => {

    const isAuthenticated = localStorage.getItem('token') !== null;

    return (
        <header className='header'>
            <div className='left'>
                <img src={logo} alt='logo' className='logo' />
                <p>SoftwareSensei.ai</p>
            </div>
            <nav className='middle'>
                <a href='/'>Home</a>
                <a href='sensei'>Sensei</a>
                <a href='tokens'>Tokens</a>
            </nav>
            <div className='right'>
                {isAuthenticated ? (
                    <><button className='profile-picture' /><DropdownMenu /></>
                ) : (
                    <button onClick={() => window.location.href = '/signin'} className='sign-in-button'>Sign In</button>
                )}
            </div>
        </header>
    );
};

export default Header;
